const _hoisted_165 = /*#__PURE__*/_createStaticVNode("<p data-v-0243a11c>The toxicity study was performed to assess the potential systemic toxicity and biocompatibility of a polar extract (Physiological saline) and non-polar extract (Sesame oil) of “XXXXXXXXXXXXXXXX” by injecting both polar extract (i.e., by slow bolus intravenous injection) and non-polar extract (i.e., by slow bolus intraperitoneal injection) for single administration. Also, this test provides information on health hazards likely to arise from acute exposure by the intended clinical route in humans. The study was performed as per the guideline ISO 10993-11:2017- Biological Evaluation of Medical Devices - Part 11.</p><p data-v-0243a11c>Test item thickness is less than 0.5mm, 6cm2/mL was selected for extraction as per ISO 10993-12:2021 (Annexure 1).</p><p data-v-0243a11c>Sterilization of test item: Before extraction test item was autoclaved for 1 hrs at 121.0 °C.</p><p data-v-0243a11c>60cm2 of Test Item taken and transferred to the sterile beaker container containing 10 mL of 0.9% NaCl (vehicle). 60cm2 of Test Item taken and transferred to the sterile beaker container containing 10 mL of sesame oil (vehicle).</p><p data-v-0243a11c>Similar procedure was followed for polar and non-polar vehicle control without test item and was subjected to extraction at 37.0°C for a period 73 hrs and 31 mins in orbital shaker incubator at 110 rpm. Before extraction, beakers were washed with distilled water. Test item in respective Polar and non-polar were observed for clarity of extraction and found to be clear without any particles during pre and post-extraction period.</p><p data-v-0243a11c>pH of polar and non-polar test item extracts and control was checked using pH strips and pH was measured between 6-7.</p><p data-v-0243a11c>Twenty two Female mice were acclimatized and twenty were randomized into four group’s viz.G1a-polar control, G2a- polar extract, G1b-non-polar control and G2b-non-polar extract. Polar and Non-polar control and extracts were administered by single intravenous and intraperitoneal route, respectively. A dose volume of 50 mL/kg was used for both intravenous and intraperitoneal routes of administration. </p><p data-v-0243a11c>Animals were observed for Clinical Signs at time intervals of 1 hr, 2 hrs, 3 hrs, 4 hrs, 24 hrs, 48 hrs and 72 hrs post administration.</p><p data-v-0243a11c>Body weights were measured on day 1 of acclimatization, Day 1 of dosing (pre-dose) and on Day 2, Day 3 and Day 4 of the in-life. All the animals were monitored for mortality, morbidity, abnormal behavior and signs of biological reactivity during the observation period.</p><p data-v-0243a11c>There was no mortalities, morbidity and clinical sings / no abnormal behavior during the course of the observation period. No treatment related changes in body weights in any of the mouse tested.</p><p class=\"font-weight-bold\" data-v-0243a11c>Conclusion:</p><p data-v-0243a11c>Based on the above results and under the conditions of this study, the Polar and Non-polar extract of “Condoms Ritex GELB BANANE” at dose volume of 50 mL/kg did not showed any acute systemic toxicity in Swiss Albino Mice.</p>", 12);
